  18,\n\t\"tags\": [],\n\t\"title\": \"Temperature, salinity and other variables collected
  from discrete sample and profile observations using CTD, bottle and other instruments
  from THOMAS G. THOMPSON in the North Pacific Ocean and Papahanaumokuakea Marine
  National Monument from 1985-03-30 to 1985-04-30 (NCEI Accession 0143395)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-29T01:19:45.502486\",\n\t\"name\": \"temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation22928\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0143395 includes discrete
  sample and profile data collected from THOMAS G. THOMPSON in the North Pacific Ocean
  and Papahanaumokuakea Marine National Monument from 1985-03-30 to 1985-04-30 and
  retrieved during cruise TPS24_1. These data include CHLOROFLUOROCARBON-11 (CFC-11),
  CHLOROFLUOROCARBON-12 (CFC-12), DELTA HELIUM-3, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, Potential temperature (theta), SALINITY, Tritium (Hydrogen
  isotope), WATER TEMPERATURE, phosphate and silicate. The instruments used to collect
  these data include CTD and bottle.nnThese data were collected by Melinda Hall of
  University of California - San Diego; Scripps Institution of Oceanography as part
  of the WOCE_P03E_TPS24_1 data set.nnThe World Ocean Circulation Experiment (WOCE)
  was a major component of the World Climate Research Program with the overall goal
  of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
